import { NgModule } from "@angular/core";
import { CommonModule } from "@angular/common";

import { Component } from "@angular/core";

@Component({
  selector: "my-component, MyComponent",
  template: `
    <div class="div">
      <span class="span">
        <div class="div-2">© 2023 AdsTrees</div>
        <span class="span-2">
          <div class="div-3">Privacy</div>
          <div class="div-4">Terms</div>
          <div class="div-5">Donate</div>
        </span>
      </span>
    </div>
  `,
  styles: [
    `
      .div {
        align-self: stretch;
        background-color: var(--whitePure, #081c15);
        display: flex;
        flex-direction: column;
        justify-content: center;
        padding: 8px 16px;
      }
      .span {
        align-items: center;
        align-content: center;
        flex-wrap: wrap;
        display: flex;
        padding-right: 80px;
        justify-content: space-between;
        gap: 8px;
      }
      @media (max-width: 991px) {
        .span {
          max-width: 100%;
          padding-right: 20px;
        }
      }
      .div-2 {
        color: var(--greenDark, #e8f5f1);
        flex-grow: 1;
        white-space: nowrap;
        margin: auto 0;
        font: 500 14px Poppins, sans-serif;
      }
      @media (max-width: 991px) {
        .div-2 {
          white-space: initial;
        }
      }
      .span-2 {
        align-self: stretch;
        display: flex;
        gap: 8px;
        padding: 4px 0;
      }
      .div-3 {
        color: var(--greenDark, #e8f5f1);
        flex-grow: 1;
        white-space: nowrap;
        font: 500 14px Poppins, sans-serif;
      }
      @media (max-width: 991px) {
        .div-3 {
          white-space: initial;
        }
      }
      .div-4 {
        color: var(--greenDark, #e8f5f1);
        font: 500 14px Poppins, sans-serif;
      }
      .div-5 {
        color: var(--greenDark, #e8f5f1);
        flex-grow: 1;
        white-space: nowrap;
        font: 500 14px Poppins, sans-serif;
      }
      @media (max-width: 991px) {
        .div-5 {
          white-space: initial;
        }
      }
    `,
  ],
})
export class MyComponent {}
